window.bookSummaryJSON = "<p><b>I wake in a cage at the gilt market with no memory of my name.</b></p> <p>When the fae King of Storms and Feathers purchases me, I vow to escape his palace of dust and gold, reclaim my memories, and return to the home that haunts my visions—a city of ruins in the decaying forests of the human realm.</p> <p>In the meantime, I’ll pretend to be what King Arrowyn wants—an obedient green-eyed bird, chained and powerless, his for the taunting and taking.</p> <p>But when I escape and fall into viler clutches, Arrow hunts me down, determined to retrieve his disobedient, most valued possession.</p> <p><i>For listeners who fall for villains, enjoy angsty enemies-to-lovers tension, a strong human heroine, and a very morally gray fae king! This audio book contains dark themes, a cliff hanger with a scream-out-loud plot twist, and is suitable for mature listeners.</i></p> <p><b>Welcome to the dark side where the villain will break your heart, then piece it back together in better shape than ever... </b><b><i>eventually</i></b><b>.</b></p>"; 
